import React from "react";

const BlogList = ({ title, blogs }) => {
  return (
    <div>
      <h1>{title}</h1>
      {blogs.map((index) => (
        <div key={index.id}>
          <h1>{index.title}</h1>
        </div>
      ))}
    </div>
  );
};

export default BlogList;
